import React from 'react';
// import { Link } from 'react-router-dom';
import { NavLink } from 'react-router-dom';

function ClientSidebar() {
    return (
        <aside className="sidenav">
            <img src={require('./Assets/PrakriaLogo_Final.png')} alt="Prakria Direct Logo" className='Logo' />
            <button className='create-btn'>Create a project</button>
            <nav className='nav-menu'>
                <ul>
                    <li><NavLink style={{ color:"red"}} to={"/client/projects"}>Projects</NavLink></li>
                    <li><NavLink to={"/client/brands"} className={({isActive}) => (isActive ? "list-item-active" : 'none')}>Brands</NavLink></li>
                    <li><NavLink to={"/client/files"} className={({isActive}) => (isActive ? "list-item-active" : 'none')}>Files</NavLink></li>
                    <li><NavLink to={"/client/resource"} className={({isActive}) => (isActive ? "list-item-active" : 'none')}>Add a Resource</NavLink></li>
                    <li><NavLink to={"/client/account"} className={({isActive}) => (isActive ? "list-item-active" : 'none')}>Account</NavLink></li>
                    <li>Logout</li>
                </ul>
            </nav>
        </aside>
    );
}

export default ClientSidebar;
